INSERT INTO `growth` VALUES ('37', '-2', '14', '此生不长，唯有珍爱，人生的路到底有多远并不重要，当务之急是珍惜生命的每一秒。人的一生，既不是人们想象的那么好，也不是人们想象的那么坏。人生最大的快乐不在于占有什么，而在于追求的过程。', '2014-12-15 21:27', '2', '2014-12-20 23:04', 'UPDATE');
INSERT INTO `growth` VALUES ('39', '-2', '14', '有些路，通往哪里并不重要，重要的是你会在路上看到什么样的风景。有的人来了，又去了，穿越的只是自己人生的必经路线而已，并且不时的客串一下别人的境地，不曾有交集，空旷的世界只有忽远忽近的回音，那是自己的叹息，还有不曾说出口的每一种别离。', '2014-12-15 22:37', '2', '2014-12-20 23:04', 'UPDATE');
INSERT INTO `growth` VALUES ('40', '-2', '14', '有时候你需要接受现实，有些事永远也回不去以前的样子了', '2014-12-16 13:21', '2', '2014-12-20 23:04', 'UPDATE');
INSERT INTO `growth` VALUES ('41', '1', '18', '傻逼', '2014-12-16 17:31', null, '2014-12-16 17:31', 'ADD');
INSERT INTO `growth` VALUES ('42', '1', '18', '傻逼  宋二逼', '2014-12-16 17:45', '1', '2015-02-10 17:30', 'UPDATE');
INSERT INTO `growth` VALUES ('43', '-2', '14', '[cp]人生没有绝对的公平，而是相对公平。 在一个天平上，你得到越多，势必要承受更多，每一个看似低的起点，都是通往更高峰的必经之路。', '2014-12-16 23:09', '1', '2014-12-16 23:09', 'UPDATE');
INSERT INTO `growth` VALUES ('44', '-2', '14', '在不幸的源头，总有一桩意外。在幸福的源头，总有一桩巧合。', '2014-12-17 16:41', '1', '2014-12-20 23:04', 'UPDATE');
INSERT INTO `growth` VALUES ('45', '-2', '17', '对这段话一直深信不疑~', '2014-12-18 21:14', '3', '2015-01-30 11:09', 'UPDATE');
INSERT INTO `growth` VALUES ('46', '-1', '14', '嘎嘎。。。。。', '2014-12-18 22:27', '5', '2015-02-15 21:41', 'UPDATE');
INSERT INTO `growth` VALUES ('47', '-2', '24', '生命很有限，无须太多人。世间看似熙攘，其实喧嚣在身外，没几个人有关联。我们的幻觉是，自己不可或缺，总在那自以为是。这不过是一厢情愿罢了，地球离开谁都转，每个人都在谋求生存。孤单与狂欢，如花开草长，上演着命运的开启或谢幕。弥足珍贵的，是那些静默的陪伴，深谙你的内心，方是你的至爱。', '2014-12-19 11:23', '1', '2014-12-20 23:04', 'UPDATE');
INSERT INTO `growth` VALUES ('48', '-1', '25', '卡拉啦啦啦啦啦', '2014-12-19 14:03', '2', '2015-02-06 05:27', 'UPDATE');
INSERT INTO `growth` VALUES ('49', '5', '28', 'nnnxk', '2014-12-19 18:16', '0', '2014-12-19 18:17', 'UPDATE');
INSERT INTO `growth` VALUES ('50', '2', '14', '有喜欢的吗', '2014-12-19 22:57', '1', '2014-12-19 22:58', 'UPDATE');
INSERT INTO `growth` VALUES ('51', '-2', '14', '[cp]时间告诉你什么叫衰老，回忆告诉你什么叫幼稚。[/cp]', '2014-12-20 10:22', '1', '2014-12-22 09:45', 'UPDATE');
INSERT INTO `growth` VALUES ('52', '4', '14', '时间告诉你什么叫衰老，回忆告诉你什么叫幼稚。', '2014-12-20 10:22', '4', '2015-02-11 22:52', 'UPDATE');
INSERT INTO `growth` VALUES ('53', '-2', '13', '收拾起心情，继续走吧，错过花，你将收获雨，错过这一个，你才会遇到下一个。', '2014-12-20 23:04', '1', '2014-12-21 08:26', 'UPDATE');
INSERT INTO `growth` VALUES ('54', '-2', '14', '[cp]到了一定年龄，便要学会寡言，每一句话都要有用，有重量。喜怒不形于色，大事淡然，有自己的底线。[/cp]', '2014-12-23 21:29', null, '2014-12-23 21:29', 'ADD');
INSERT INTO `growth` VALUES ('55', '-2', '14', '[cp]面朝大海，春暖花开。在蹉跎的岁月中形成独自特有的芬芳，在生活里散发，一点点穿透自己的人生。人生是一场追求，也是一场领悟。不要以为得到了什么，其实人时时刻刻都是在失去，失去时间，失去生命，失去更多的财富，失去更多的机会。不要抓得太紧，抓得越紧，丢失的会越多。[/cp]', '2014-12-25 23:57', null, '2014-12-25 23:57', 'ADD');
