INSERT INTO `growth` VALUES ('70', '-2', '13', '[cp]如果别人惹了你，并不需要去报复。因为智商差是这世上最远的距离，别人做一件极坏的事，你跟着做，就等于把自己也拉低到同样层级。当有人和你过不去时，请远离小人，保持平静的心情。不要生气，但更不要记得。对付一个人最狠的办法，不是教训他，而是从记忆里删除他。[/cp]', '2015-01-08 17:41', null, '2015-01-08 17:41', 'ADD');
INSERT INTO `growth` VALUES ('71', '11', '13', '', '2015-01-08 22:46', null, '2015-01-08 22:46', 'ADD');
INSERT INTO `growth` VALUES ('72', '-2', '13', '老师说了一段让人深思的话：催菜的时候说“不要了”比“快点上”更管用，砍价的时候说“再看看”比“便宜点”更管用，挽留的时候说“你走啊”比“别这样”更管用——留不住的东西就用力把它往远得扔，没准撞到什么就弹回来了。', '2015-01-09 08:46', null, '2015-01-09 08:46', 'ADD');
INSERT INTO `growth` VALUES ('73', '7', '13', '', '2015-01-10 11:59', null, '2015-01-10 11:59', 'ADD');
INSERT INTO `growth` VALUES ('74', '-2', '13', '[cp]不是每个人都适合与你白头到老。有的人，是拿来帮你成长的；有的人，是拿来一起生活的；有的人，是拿来一辈子怀念的。有些人相信真爱，但是越爱就越是痛苦。放弃吧又不舍得，继续吧又受不了，所以才会纠结难过。其实，不是真爱你也就能在一起的。想要好好生活，重点就在于爱对人。[/cp]', '2015-01-12 08:55', null, '2015-01-12 08:55', 'ADD');
INSERT INTO `growth` VALUES ('75', '7', '13', '', '2015-01-12 12:50', '1', '2015-02-07 14:08', 'UPDATE');
INSERT INTO `growth` VALUES ('76', '-2', '13', '[cp]愚公费了一辈子劲终于把门前的王屋太行挖走了，不想却把蛇精和蝎子精放了出来。无奈，愚公就种了一根葫芦，生出7个葫芦娃，葫芦7兄弟勇斗妖精，最后和在一起化作一个大山再次将妖精镇压……！愚公哭了，你们TM在玩我[泪]转[/cp]', '2015-01-12 22:11', null, '2015-01-12 22:11', 'ADD');
INSERT INTO `growth` VALUES ('77', '-2', '13', '[cp]时间是往前走的，钟不可能倒着转，所以一切事只要过去，就再也不能回头。这世界上即使看来像回头的事，也都是面对著完成的。我们可以转身，但是不必回头，即使有一天，你发现自己走错了，你也应该转身，大步朝著对的方向去，而不是回头怨自己错了。[/cp]', '2015-01-12 22:17', null, '2015-01-12 22:17', 'ADD');
INSERT INTO `growth` VALUES ('78', '-2', '69', '也许有一天你会不会', '2015-01-13 10:40', null, '2015-01-13 13:16', 'UPDATE');
INSERT INTO `growth` VALUES ('79', '-2', '13', '[cp]我发状态传照片，不是为了告诉谁，我吃什么了，做什么了，和谁在一起，更不是要得瑟给谁看。而是有一天自己真的老了，搬着凳子无事可做晒太阳的时候，能拿出自己的流水式日记看一看，回忆一下那年那月，和朋友在一起的点点滴滴，自己年轻时的容颜……证明这个世界我来过，而且活的真实而精彩。[/cp]', '2015-01-14 20:12', null, '2015-01-14 20:12', 'ADD');
INSERT INTO `growth` VALUES ('80', '17', '138', '古风幽幽的长流，在心中缓缓流淌...', '2015-01-18 20:19', '1', '2015-01-20 06:48', 'UPDATE');
INSERT INTO `growth` VALUES ('81', '-2', '13', '[cp]洒脱，是人生最美的心境。拥有这份心境，生活会多一些淡定，喜悦，平和；少一些浮躁，忧伤，抱怨。阳光不同，是因为心情不同；绿叶不同，是因为风向不同。生活就是这样，人生会面对不同的选择，不管你的选择是什么，请别忘记：路是自己走出来的的，快乐是自己创造出来的！[/cp]', '2015-01-21 09:53', null, '2015-01-21 09:53', 'ADD');
