INSERT INTO `growth` VALUES ('123', '49', '356', '生命没有输赢，只有值不值。该得到的，要付出努力抓到手，不该得到的，想也不要去想。做这样一个淡淡的女子，有自己的喜好，有自己的原则，有自己的信仰，不急功近利，不浮夸轻薄，做到宠辱不惊，也会大笑，也会打闹，心，却静如水。淡定安逸，学会懂得，从而学会慈悲', '2015-02-09 09:22', '4', '2015-02-13 03:00', 'UPDATE');
INSERT INTO `growth` VALUES ('124', '-2', '70', '人生百相，世态万千，生活中，有一种无言的爱，叫自爱。它，是一条静静的溪流，不需要别人懂得，是独自的流淌；它，是一曲曼妙的音乐，不需要刻意雕饰，是独自的聆听；它，是一朵清丽的闲花，不需要所谓的追逐，所谓的奢望，是独自的微笑，独自的世界。', '2015-02-09 09:31', '4', '2015-02-09 22:47', 'UPDATE');
