INSERT INTO `growth` VALUES ('135', '-2', '381', '年轻时的弯路，我们非走不可\n\n在青春的路口，曾经有那么一条小路若隐若现，召唤着我。\n\n母亲拦住我：“那条路走不得。”\n\n我不信。\n\n“我就是从那条路走过来的，你还有什么不信？”\n\n“既然你能从那条路走过来，我为什么不能？”\n\n“我不能让你走弯路。”\n\n“但是我喜欢，而且我不怕。”\n\n母亲心疼地看了我好久，然后叹口气：“好吧，你这个倔强的孩子，那条路很难走，一路小心！”\n\n上路后，我发现母亲没有骗我，那的确是条弯路，我碰壁，摔跟头，有时碰得头破血流，但我不停地走，终于走过来了。\n\n坐下来喘息的时候，我看见一个朋友，自然很年轻，正站在我当年的路口，我忍不住喊：“那条路走不得。”\n\n她不信。\n\n“我母亲就是从那条路走过来的，我也是。”\n\n“既然你们都可以从那条路走过来，我为什么不能？”\n\n“我不想让你走同样的弯路。”\n\n“但是我喜欢。”\n\n我看了看她，看了看自己，然后笑了：“一路小心。”\n\n我很感激她，她让我发现自己不再年轻，已经开始扮演“过来人”的角色，同时患有“过来人”常患的“拦路癖”。\n\n在人生的路上，有一条路每个人非走不可，那就是年轻时候的弯路。不摔跟头，不碰壁，不碰个头破血流，怎能炼出钢筋铁骨，怎能长大呢？', '2015-02-12 17:33', '4', '2015-02-14 23:57', 'UPDATE');
